-- reviews


UPDATE reviews  
   SET
author_id = FLOOR(1 + (RAND() * 100));



-- users_rates



UPDATE users_rates  
   SET
user_id = FLOOR(1 + (RAND() * 100)),
movie_id = FLOOR(1 + (RAND() * 50));


-- friendship




UPDATE friendship SET
  user_id = FLOOR(1 + (RAND() * 100)),
  friend_id = FLOOR(1 + (RAND() * 100));

